window.bookSummaryJSON = "<p>An amateur witch. A dark past. A fierce deceit.</p> <p>Paladin Agent Alice Skye didn’t think much of the contract forced upon her by Rexley Wild, Alpha of one of the largest packs in Europe.&nbsp;</p> <p>He hired her for one job.&nbsp;</p> <p>Find the missing wolf.</p> <p>Unfortunately for Alice, she might already be too late.</p> <p>She's in way over her head, an inexperienced witch who has to use all her instincts to help the secretive and detached Alpha find his missing packmate. But it isn’t long before she realises something’s not quite right. It's not simply a missing person, it was something a lot closer to home, something that reignites nightmares that make her question her own, horrific past.</p> <p>Alice is in a race against time that forces her to face against vampires, daemons, and anything that gets in the way, for she only has one thing to do, find the wolf before he turns up like the others.&nbsp;</p> <p>Dead.</p> <p>Unexpected twists, dark secrets, and nail-biting action that will keep you on the edge of your seat.</p> <p>Alice Skye is the exciting brand new urban fantasy series by Taylor Aston White. Follow Alice as she battles her nightmares in the modern world of magic.</p>"; 
